import React from 'react';

const Card = () => {
    return(
        <div className='container d-flex justify-content-center'>
            <div class="card text-center">
                <div class="card-header">
                    Loterijos bilietas #001
                </div>
                <div class="card-body">
                    <a href="#" class="btn btn-primary">Nusipirkti</a>
                </div>
            </div>
        </div>
    )
}

export default Card;
